import React from 'react';
import { Link } from 'react-router-dom';
import { Container, Typography, Button } from '@mui/material';
import { Grid } from '@mui/material';
import hero from '../images/hero.jpg';

function HomePage() {
  return (
    <Container
      maxWidth="xl"
      sx={{
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
        padding: 0,
      }}
    >
      <div
        style={{
          backgroundImage: `linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(${hero})`,
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          width: '100%',
          height: '100%',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          marginBottom: '2rem',
          position: 'relative',
        }}
      >
        <div
          style={{
            position: 'absolute',
            top: 0,
            left: 0,
            width: '100%',
            height: '100%',
            backgroundColor: 'rgba(0, 0, 0, 0.5)',
          }}
        ></div>
        <Typography
          variant="h2"
          component="h1"
          align="center"
          sx={{
            color: 'white',
            textShadow: '2px 2px 4px rgba(0, 0, 0, 0.5)',
            marginBottom: '1rem',
            zIndex: 1,
          }}
        >
          QuantReady
        </Typography>
        <Button
          variant="contained"
          size="large"
          sx={{ backgroundColor: '#1976D2', color: 'white', zIndex: 1 }}
          component={Link}
          to="/login"
        >
          Get Started
        </Button>
      </div>

      {/* Rest of the content */}
      
    </Container>
  );
}

export default HomePage;
